import{_ as o,c as e,o as r,ag as a,j as l}from"./chunks/framework.DXCYPbuZ.js";const g=JSON.parse('{"title":"安装说明","description":"","frontmatter":{},"headers":[],"relativePath":"zh/start/install.md","filePath":"zh/start/install.md"}'),s={name:"zh/start/install.md"};function i(n,t,d,c,p,h){return r(),e("div",null,[...t[0]||(t[0]=[a('<h1 id="安装说明" tabindex="-1">安装说明 <a class="header-anchor" href="#安装说明" aria-label="Permalink to &quot;安装说明&quot;">​</a></h1><h2 id="安装路径要求" tabindex="-1">安装路径要求 <a class="header-anchor" href="#安装路径要求" aria-label="Permalink to &quot;安装路径要求&quot;">​</a></h2><p><strong>安装路径不能带中文，不能有空格!!!</strong></p><p><strong>Wndows电脑</strong>安装路径尽量选择在固态硬盘上，不要把安装目录设置到机械硬盘上，因为机械硬盘的读写速度较慢，会导致AI外贸通运行缓慢，以及其它异常。</p><h2 id="电脑配置要求" tabindex="-1">电脑配置要求 <a class="header-anchor" href="#电脑配置要求" aria-label="Permalink to &quot;电脑配置要求&quot;">​</a></h2><blockquote><p>注意：以下硬件环境是经过我们产品长期测试稳定推荐的，安装途中有无法解决的问题可联系客服免费远程解决</p></blockquote><p><strong>由于我们软件使用的自签名证书，会被360/Macfee误删文件导致AI外贸通内置指纹浏览器无法正常启动，建议关闭或者卸载360/Macfee，有防护需求使用系统自带防火墙或者是火绒即可</strong></p><table tabindex="0"><thead><tr><th>电脑类型</th><th>系统</th><th>处理器</th><th>内存</th><th>注意</th></tr></thead><tbody><tr><td>Windows电脑</td><td>建议Windows 10+</td><td>X86架构,64位处理器</td><td>建议16GB及以上</td><td>不支持Windows7/8</td></tr><tr><td>苹果电脑</td><td>建议MacOS 13+</td><td>必须M系列芯片</td><td>建议16GB及以上</td><td>Intel类型的CPU不支持</td></tr></tbody></table><h2 id="视频介绍" tabindex="-1">视频介绍 <a class="header-anchor" href="#视频介绍" aria-label="Permalink to &quot;视频介绍&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">提示</p><p>以下为Youtube视频，请在海外环境下观看</p></div>',10),l("iframe",{width:"100%",height:"390",src:"https://www.youtube.com/embed/0dgtS615C3k?si=3W_pQjGYGMtL5-nG",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",referrerpolicy:"strict-origin-when-cross-origin",allowfullscreen:"",style:{"background-color":"#E7E9EB","background-image":"url(https://spub.xrobot.tech/assets/images/youtube.svg)","background-poisition":"center","background-repeat":"no-repeat","background-size":"8%"},loading:"lazy"},null,-1),a('<h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><blockquote><p>问题无法解决请联系售后远程</p></blockquote><ol><li><p>安装完无法启动</p><div class="danger custom-block"><p class="custom-block-title">部分用户电脑无法启动解决方案</p><p>某些版本的windows系统没有预装常用的运行库，启动AI外贸通桌面版本会失败并提示<strong>xxx.dll</strong>丢失，或者没有任何提示，无法正常启动，安装好 <strong>Micosoft Visual C++ 运行库</strong>即可</p></div><p><a href="https://spub.xrobot.tech/app/VC_redist.x64.exe" target="_blank" rel="noreferrer">Micosoft Visual C++ 运行库下载</a></p></li><li><p>启动后依赖组件自动下载失败</p><ul><li>将电脑DNS改成 8.8.8.8/4.4.4.4</li><li>尝试切换线路，目前支持<strong>中国大陆/海外</strong>这两种线路,切换好之后多次尝试重启AI外贸通</li><li>以上方法不起效可以尝试本机开VPN全局代理,再重启AI外贸通</li></ul></li></ol><h2 id="mac电脑额外设置" tabindex="-1">Mac电脑额外设置 <a class="header-anchor" href="#mac电脑额外设置" aria-label="Permalink to &quot;Mac电脑额外设置&quot;">​</a></h2><p>系统版本最低要求是<strong>14.2</strong>,低于这个版本请升级系统</p><p>找到您的软件安装的数据目录,按照如下路径可以找到安装系统依赖的脚本 <strong>[数据目录]/cache/robot_[版本]/scripts/install_deps.sh</strong>，在终端执行<strong>install_deps.sh</strong>，等待执行结束即可，不知道怎么执行脚本，联系客服远程!</p><h2 id="windows防火墙设置" tabindex="-1">Windows防火墙设置 <a class="header-anchor" href="#windows防火墙设置" aria-label="Permalink to &quot;Windows防火墙设置&quot;">​</a></h2><blockquote><p>部分电脑需要关闭防火墙之后，AI外贸通才可以正常运行，打开Window安全中心，执行如下操作</p></blockquote><h4 id="_1-关闭防火墙和网络保护" tabindex="-1">1.关闭防火墙和网络保护 <a class="header-anchor" href="#_1-关闭防火墙和网络保护" aria-label="Permalink to &quot;1.关闭防火墙和网络保护&quot;">​</a></h4><p>分别点击三种不同的网络环境，进入设置界面将防火墙开关关闭即可</p><p><img src="https://spub.xrobot.tech/blog/src/img/install1.jpg" alt="关闭防火墙和网络保护" loading="lazy"><img src="https://spub.xrobot.tech/blog/src/img/install2.jpg" alt="关闭防火墙和网络保护" loading="lazy"></p><h4 id="_2-关闭应用和浏览器控制" tabindex="-1">2.关闭应用和浏览器控制 <a class="header-anchor" href="#_2-关闭应用和浏览器控制" aria-label="Permalink to &quot;2.关闭应用和浏览器控制&quot;">​</a></h4><p>进入应用和浏览器控制设置界面，点击点击基于声誉保护设置，将里面开关全部关闭</p><p><img src="https://spub.xrobot.tech/blog/src/img/install3.jpg" alt="关闭应用和浏览器控制" loading="lazy"><img src="https://spub.xrobot.tech/blog/src/img/install4.jpg" alt="关闭应用和浏览器控制" loading="lazy"></p><h4 id="_3-关闭病毒扫描" tabindex="-1">3.关闭病毒扫描 <a class="header-anchor" href="#_3-关闭病毒扫描" aria-label="Permalink to &quot;3.关闭病毒扫描&quot;">​</a></h4><p><strong>提前卸载所有第三方杀毒软件</strong>，比如360/Macfee等，因为有不少杀毒软件会默认限制内网的访问，导致AI外贸通无法正常运行，相对于修改各个杀毒软件的设置，我们建议直接卸载</p><p>进入病毒和威胁防护，关闭下图所展示的病毒防护相关的设置选项</p><p><img src="https://spub.xrobot.tech/blog/src/img/install7.png" alt="关闭病毒扫描" loading="lazy"></p><p>进入管理设置界面，关闭所有的开关</p><p><img src="https://spub.xrobot.tech/blog/src/img/install8.png" alt="关闭病毒扫描" loading="lazy"></p>',20)])])}const u=o(s,[["render",i]]);export{g as __pageData,u as default};
